import React, { useEffect } from 'react';
import "./login.scss";

const Login = () => {

  useEffect(() => {
    const characters = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789";

    const generateRain = () => {
       const rainElement = document.querySelector(".rain");
       for (let i = 0; i < 500; i++) {
          const span = document.createElement('span');

          const randomChar = characters.charAt(Math.floor(Math.random() * characters.length));
          span.innerHTML = randomChar; // set the innerHTML to the random character

          span.style.top = `${Math.random() * 100}%`;
          span.style.left = `${Math.random() * 100}%`;
          span.style.fontSize = `${Math.random() * 16 + 12}px`;
          span.style.animationDelay = `${Math.random() * 2}s`;
          span.style.animationDuration = `${Math.random() * 3 + 2}s`;
          rainElement.appendChild(span);
       }
    }

    generateRain();
 }, []);

  return (
    <div className="login">
      <div className="rain"></div> {/* Matrix Rain effect here */}
      <div className="card">
        <div className="left">
          <h1>Hello world!</h1>
          <p>welcome to my socialmedia site! this is a social media platform for developers, programmers and everything alike.</p>
          <span>dont have an account?</span>
          <button>register</button>
          <button>guest account</button>
        </div>
        <div className="right">
          <h1>login</h1>
          <form >
            <input type="text" placeholder="username"/>
            <input type="text" placeholder="password" />
            <button>login</button>
          </form>        
        </div>
      </div>
    </div>
  )
}

export default Login;
